function searchTags(ts){
	if(ts.length<1)return;
	if(ts=="_")return displayMatched(data);
	let matched=[];
	let tags=ts.split(" ");
	for(let k=0;k<data.length;k++){
		let tm=0;
		for(let t=0;t<tags.length;t++){
			for(let dt=0;dt<data[k].tags.length;dt++){
				let dtv=data[k].tags[dt];
				let tv=tags[t];
				if(dtv==tv||dtv.startsWith(tv)){
					tm++;
				}
			}
		}
		if(tm>=tags.length)matched.push(data[k]);
	}
	displayMatched(matched);
}
function appendHtml(par,h){
	let d=document.createElement("div");
	d.innerHTML=h;
	par.appendChild(d.children[0]);
}
function displayMatched(m){
	results.innerHTML="";
	for(let i=0;i<m.length;i++){
		let e=m[i];
		appendHtml(results,`
		<div class=item>
			<h2>${e.name}</h2>
			<img src='${e.img}'></img>
			<img src='${e.loc}'></img>
			<span>${e.tags.join(", ")}</span>
		</div>
		`);
	}
}
data.sort(({name:a},{name:b})=>a.localeCompare(b));
console.log([...data].filter(e=>e.name.length>1).length+" places");
